  [],\n\t\"revision_timestamp\": \"2015-05-07T00:54:49.841827\",\n\t\"name\": \"fieldable-real-time-no2-sensor-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This Small Business Innovative Research
  Phase I proposal seeks to develop a compact, autonomous NO2 sensor for air monitoring
  applications based on laser induced fluorescence (LIF).  A key component in the
  proposed system is new laser technology developed at NovaWave.  The Phase I research
  will directly demonstrate the utility of this new light source by performing LIF
  measurements on NO2 samples in a laboratory setting.  The Phase II system will fully
  integrate the laser with an autonomous spectrometer and air sampling system to comprise
  a complete sensor package. Phase III will result in the development of fieldable
  commercial systems that will be manufactured and distributed to the regional end
  users.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
